The '''Sirsal Bankers''' are two [[banker]]s who run the [[bank]] on [[Lunar Isle]]. They are two of the only three men on Lunar Isle (the third is the pirate-banker [['Bird's-Eye' Jack]]). Like the women of the [[Moon Clan]], the two bankers float behind the bank's counter.

Before completing [[Dream Mentor]], players need a [[Seal of passage]] to bank with them, and if they try to bank without one, they will be sent off the island, to [[Rellekka]]. After completing the quest, players can bank with 'Bird's-Eye' Jack through their dialogue without needing the seal.

This is the closest bank to the [[Astral Altar]] and is used by players when crafting [[Astral rune]]s.

